  <p><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Bir bor ekan, bir yo‘q ekan, bir zamonlarda Misr mamlakatida bir podsho o‘tgan ekan. Uning otini Abdulaziz shoh der ekanlar. Shohning Abdukarim degan vaziri ham bor ekan. Abdulaziz shoh bilan Abdukarim vazir juda inoq ekanlar.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Ular yoshlikda madrasada birga o‘qishgan, ayniqsa, Abdukarim nihoyatda tirishqoq ekan. O‘zi kambag‘al oilasidan bo‘lishiga qaramay, butun kuch-quvvatini ilmga berar, uni chuqurroq o‘zlashtirishga harakat qilar ekan. Abdukarim vazir har vaqt shohga:</span>
  <br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/>
