  <span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Bu dunyo o‘tar dunyo, yaxshilik qilsang ham o‘tadi, yomonlik qilsang ham o‘tadi, xalq bizning onamiz bo‘ladi. Shuning uchun xalqqa yaxshilik qilmoq kerak. Yomonlik qilish har kishining qo‘lidan keladi, ammo yaxshilik qilish har kimning qo‘lidan kelavermaydi, — der ekan. Ular har bir ishni bamaslahat bajarishar ekan. Mamlakat ham o‘sha davrda tinch va obod ekan. Lekin ular dunyoning bir kamchiligidan nihoyatda xafa ekanlar. Shoh ham, vazir ham befarzand ekan.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Kunlardan bir kun shohning saroyiga bir qalandar kelibdi. Shoh qalandarni o‘z oldiga chaqirib olib, unga:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Ey qalandar, siz jahongashta odamsiz, ko‘p shahar va qishloqlarni kezgansiz. Ko‘p odamlarni duo qilasiz. Menga farzandsizlikning chorasini aytib berolmaysizmi? — debdi. Qalandar:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Bilaman, — deb qo‘ynidan ikki olmani chiqarib, birini shohga, birini vazirga berib, duo qilibdi. — Biringizga xudo o‘g‘il, biringizga qiz beradi, ammo ikkovingiz bir-biringiz bilan quda bo‘lasiz, — deb qalandar shoh bilan vazirdan in’om va ehsonlar olib jo‘nab ketibdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Olmani yeganlaridan so‘ng shohning xotini o‘g‘il tug‘ibdi. Otini Xurshid qo‘yishibdi. Vazirning xotini qiz tug‘ibdi, uning otini Laylo qo‘yishibdi. Bolalar birga tarbiya ko‘rib, birga o‘sishibdi. Xurshid bilan Laylo bir mayiz topsalar bo‘lishib yer ekanlar, ittifoqlik, mehr-muhabbat kundan kunga kuchayib boraveribdi. Laylogul qizlar maktabida o‘qisa, Xurshid o‘g‘il bolalar madrasasida o‘qibdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Yildan yil, oydan oy, kundan kun o‘tib, Xurshid bilan Laylo ham o‘qishni tugatibdi. Ular o‘n sakkiz yoshga kiribdilar. Shoh o‘g‘li Xurshidni uylantirish harakatiga tushibdi. Vazirning qizi Laylogulga sovchi yuboribdi. Vazirning qizi sovchilarga:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Shahzoda Xurshidning ko‘ngli menda bo‘lsa, o‘zim bilan gaplashsin. Mening bir shartim bor. Agarda qabul etsa, men ham roziman, — debdi. Sovchilar qizning aytgan so‘zlarini Xurshidga yetkazibdilar. Xurshid vazirning uyiga boribdi. Mehmonxona o‘rtasiga parda tutilgan ekan. Pardaning orqasida o‘tirgan Laylogul shahzodaning tovushini eshitib, “Assalomu alaykum, shahzoda!” debdi. Shundan keyin ikkisi hol-ahvol so‘rashibdi. Bular maktabga kirganlaridan so‘ng, bir-birlari bilan ko‘risha olmagan ekanlar. Laylogul Xurshidning taklifiga shunday debdi:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Men qarshi emasman, biroq bir shartim bor. Agarda qabul etsangiz to‘yga roziman. Shartim shu: har kuni ertalab uyingizga boraman, kech bo‘lmasdan o‘z uyimga ketaman, — debdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Shahzoda qizning bu shartiga hayron qolib, nima javob qaytarishni bilmay qolibdi. So‘ng Xurshid aql-hushini bir joyga to‘plab, shartini qabul qilay, uyimga borgach, boshqa chorasi topilib qolar, — deb o‘ylabdi. Xurshid Laylogulga:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Shartingizni qabul etdim, — debdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">O‘n besh kun to‘y bo‘libdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Shahzoda uchun qator uylar juda yaxshilab bezatilgan ekan. Ammo bu uylarning birontasida ham kelinchak Laylogul ko‘rinmas ekan. Laylogul esa, o‘z shartiga muvofiq, to‘yning ertasigayoq erta bilan nonushtaga kirib kelibdi. Xurshid shoshilganicha Layloni kutib olibdi-da, uyga boshlabdi. Ular qator uylarni bir-bir tomosha qilib, o‘n birinchi uyga kiribdilar. Kanizak qizlar dasturxon yozibdilar. Dasturxon noz-ne’matga to‘la emish. Ular suhbatlashib o‘tirib, kunni kech qilibdilar. Laylogul boshiga paranjisini yopinib, otasining uyiga jo‘nab qolibdi. Xurshid og‘zini ochib, qizning ketidan qarab qolaveribdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Bu ahvol har kuni takrorlanaveribdi. Ko‘pincha, Laylogul parishon bo‘lar, Xurshidning gaplariga ham e’tibor bermas ekan. Xurshid nima gapligini bilolmay, og‘ir ahvolda qolibdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Kunlardan bir kun Xurshid o‘ylab-o‘ylab maktabdosh do‘sti Abdumutalning oldiga boribdi. Do‘sti madrasa hujrasida turar ekan. Xurshidni xursand bo‘lib kutib olibdi. Abdumutal sayohatga ketgani uchun ular anchadan buyon ko‘rishishmagan ekan. Abdumutal Arabistonning ko‘p shaharlaridan tashqari, Hindiston, Peshovur kabi uzoq mamlakatlarda bo‘lganini gapirib beribdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Abdumutal o‘ttiz ikki yoshlarda bo‘lib, ancha ziyrak yigit ekan. Xurshidning xafaligini kelgan zamon sezibdi. Ular ovqatlanib, choy ichib, suhbatlashib o‘tiribdilar. Abdumutal sekin gap boshlabdi:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Do‘stim Xurshid, siz shohning o‘g‘lisiz. Hamma narsa siz uchun tayyor. Husn, aql, idrok, ilmda Arabistonda yakka-yu yagona vazirning qizi sizning xizmatingizda bo‘lsa-yu, tag‘in nega xafa ko‘rinasiz?</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Mening xafaligimni qaerdan bildingiz? — deb so‘rabdi Xurshid.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Hech kimdan, lekin betlaringiz sarg‘ayganidan, xayolingiz parishonligidan gumon qilaman, — debdi u. Xurshid do‘stiga hozirgi ahvolini bir boshdan aytib beribdi. Abdumutal bu so‘zlarni eshitib, qo‘liga qog‘oz-qalam olib, qandaydir duo yozib, Xurshidning qo‘liga beribdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Mana shuni xotiningiz uydan chiqib ketayotganda peshanangiz-ga yopishtirib oling. Qizning orqasidan boravering. U sizni ko‘rmaydi. Ketidan borsangiz, hamma sir-asrordan xabardor bo‘lasiz, — debdi Abdumutal.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Xurshid xursand bo‘lib, qog‘ozni olib, o‘rtog‘iga minnatdorchilik bildirib, uyiga qaytibdi. U kechani uxlamay o‘tkazibdi. Erta bilan nonushtaga Laylogul yetib kelibdi. Kundagidek ikkisi birgalashib nonushta qilibdilar. Xurshid har kuni qani endi kech bo‘lmasa-yu, Layloning husniga to‘ysam, deb niyat qilar ekan. Bugun esa tezroq kech bo‘lsin, buning sirlarini tezroq bilib olay, deb o‘z-o‘zidan hovliqar ekan.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Nihoyat, Layloning ketar vaqti bo‘libdi. U paranjisini yopinib jo‘nab qolibdi. Xurshid ham vaqtni g‘animat bilib, peshanasiga do‘sti yozib bergan xatni yopishtirib, xotini ketidan ketaveribdi. Laylogul to‘g‘ri otasining hovlisiga kiribdi. Onasi uni ko‘rib:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Ha, keldingmi, qizim, — deb quchoqlab ko‘rishib, ikki yuzidan o‘pibdi. Boshidan paranjisini olib, ayvondagi mixga osib qo‘yibdi. Kanizak qiz xitoyi laganda osh olib kelibdi. Dasturxon atrofida vazir, Laylo, uning onasi o‘tiribdilar. Xurshid ham bexavotir o‘tirib olibdi. Hammalari ovqatga qo‘l uzatibdilar. Onasi bir suyakni Layloning oldiga qo‘yibdi. Uni Xurshid qo‘liga olib go‘shtini yegan ekan, ichidan oshiq chiqib qolibdi. U oshiqni olib, tozalab, cho‘ntagiga solib qo‘yibdi. Oshni yeb bo‘lib, ustidan bir piyoladan choy ichibdilar. Laylo o‘rnidan turib:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Oyi, men ketdim, — deb boshiga paranjisini yopinib jo‘nabdi. Xurshid ham uning ketidan ketaveribdi. Laylo borib-borib bir darvozani qoqibdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Olmagul, Olmagul! — deb chaqiribdi. Darvoza ochilibdi. Hovlida bir kelishgan chiroyli qiz olma to‘ldirilgan kumush laganni ko‘tarib turgan ekan. Laylogul olmadan birini olibdi. Uning ketidan Xurshid ham bitta olma olibdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Laylogul Olmagulga:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Do‘stim, tezroq ketaylik! — debdi. U qiz ham boshiga paranjisini yopinib chiqibdi. Hovlidan uch kishi indamasdan jo‘nabdilar. Borib-borib Olmagul yana bir darvozaning halqasini qoqibdi. Darvoza ochilibdi. Laylo: — Anorgul! — deb chaqiribdi. Bir qiz qo‘lida bir laganni anorga to‘ldirib ko‘tarib chiqibdi. Anordan Laylo bir dona, Olmagul ham bir dona, Xurshid ham bir dona olibdi. Anorgul laganni qo‘yib, boshiga paranjisini yopinib chiqibdi. Endi bular to‘rt kishi bo‘libdilar. Ular gapirishib, xaxolab kulishib borar ekanlar. Kulganda Olmagul og‘zidan olmagul, Anorgul og‘zidan anorgul to‘kilar edi. Xurshid ham birga kulishib borayotganidan ular xabarsiz ekanlar. Qizlar shahardan tashqariga chiqibdilar. Nihoyat, tevaragi baland devorlar bilan o‘ralgan bog‘ga yetibdilar. Bog‘ning darvozasi qizil yog‘ochdan yasalgan ekan. Anorgul darvozaning halqasini qoqqan ekan, ikki haybatli dev chiqib ochibdi. Devlar qizlarga qarab ta’zim qilishibdi. Xurshid ham ular orqasidan bog‘ga kiribdi. U bog‘ga qarab hayron bo‘libdi. Bog‘da yilning to‘rt faslini ko‘rish mumkin ekan: bog‘ning bir tomoni bahor — daraxtlar gullaganmish, ikkinchi tomoni esa yoz, mevalar pishib, tagiga tushib yotganmish. Uchinchi tomoni kuz, daraxtlarning bargi sarg‘ayib yerga tushayotganmish... Тo‘rtinchi tomonida esa hovuzdagi suv muzlab, qor pag‘a-pag‘a bo‘lib yog‘ib turgan ekan. Bu ajoyib bog‘ni ko‘rib Xurshid hayron qolibdi. Qizlar bog‘ning o‘rtasidagi yo‘ldan uzoqda ko‘rinib turgan qo‘rg‘on tomonga yuribdilar. Qizlar yasatilgan qirq uydan o‘tib, nihoyat, qirq birinchi uyga — saroyning bekasi Guliqahqah parining oldiga kiribdilar. U Ko‘hiqofdagi parilar podshosining qizi ekan. Guliqahqah pari Laylogulni yaxshi ko‘rib, unga yaqinroq bo‘lish niyatida shu yerga bog‘ yaratgan ekan. Laylogul parining izmidan chiqa olmas, Xurshidni qanchalik sevmasin, har kuni uni tashlab ketishga majbur ekan.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Anorgul bilan Olmagulga Guliqahqah pari Laylogulga xizmat qilasizlar, deb tayinlagan ekan.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Laylogul bilan dugonalari Guliqahqah pari oldiga kirganlarida u tilla taxt ustida yonboshlab yotgan ekan. Guliqahqah pari qizni ko‘rib, o‘rnidan turibdi va u bilan quchoqlashib ko‘rishibdi. Keyin yoniga o‘tqazibdi. Ular bir-birlaridan hol-ahvol so‘rashibdi. Dasturxon yozilibdi. Maylar suzilibdi. Xurshid ham qizlar bazmini tomosha qilib o‘tiribdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Musiqalar chalinibdi, qizlar navbati bilan raqsga tushibdilar. Oradan ancha vaqt o‘tgach, Guliqahqah pari o‘yinni to‘xtatib, qizlarga:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Charchadinglar, endi borib cho‘milinglar! — debdi. Ularning hammasi bog‘ga chiqishibdi. U yerda marmar toshdan ishlangan katta hovuz bor ekan. Hovuzning suvi nihoyatda tiniq ekan. Suv tagidagi qimmatbaho toshlar ko‘zga ko‘rinib turar ekan. Hamma qizlar yechinib, hovuzga o‘zlarini tashlabdilar. Ular bir-birlariga suv sepishib, kulishib cho‘milishar ekan. Xurshid shu paytdan foydalanib, xotini Laylogulning kiyimini olib qo‘yniga solibdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Hamma qizlar cho‘milib bo‘lib, o‘z kiyimini kiyibdi. Biroq Laylogul kiyimini topolmay hayron bo‘libdi. Bog‘ning ichi va tashqarisini rosa qidiribdilar.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Ko‘ylak ham, bironta odam ham topilmabdi. Parilarning hammasi hayron bo‘libdi. Bu yerda bunaqa hodisa hech bo‘lmagan ekan. Bundan Guliqahqah pari nihoyatda xafa bo‘libdi. O‘zicha: “Buning tagiga yetmagunimcha, topmagunimcha qo‘ymayman”, — debdi g‘azab bilan.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Pari devlarni chaqirib:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Laylo, Anorgul, Olmagullarni uylariga olib borib qo‘yinglar! — deb buyuribdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Тo‘rt dev to‘rt oyoqlik katta tosh taxtani keltirib ayvonga qo‘yibdi. Uch qiz Guliqahqah pari bilan xayrlashib taxtaga chiqib o‘tirishibdi. Xurshid hammadan avval chiqib o‘tirib olibdi. Devlar tosh taxtani osmonga ko‘tarib uchishibdi. Qizlar o‘rgangani uchun churq etishmabdi. Xurshid esa ko‘zini chirt yumib olibdi. Devlar taxta toshni yerga qo‘yishibdi. Qizlar tushib uy-uyiga jo‘nabdi. Xurshid ham uyiga kelib, kaniz qizlardan birini chaqirib, “Uyda yotaman, Laylo kelsa, meni uyg‘otasan. Lekin seni so‘ksam, ursam ham ko‘nglingga olmagin”, deb tayinlabdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Erta bilan nonushta vaqtiga Laylogul yetib kelibdi. Uyga kirib kunda o‘tiradigan joyiga borib o‘tiribdi. Laylo Xurshidni uyning bir burchagida kiyimlarini yechmasdan mast uyquda yotganini ko‘ribdi. Shu vaqt kanizlardan biri shoshilganicha kirib, Xurshid yoniga borib:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Shahzodam, turing, kelin oyim keldilar! — deb uyg‘otaveribdi. Xurshid o‘rnidan tura solib:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Ey, la’nati, yaxshi tush ko‘rayotgan edim, meni uyg‘otib, tushimni chala qilding, bor, bir kosa tiniq suv olib kel! — deb do‘q uribdi. Kanizak xitoy chinnida buloqning toza, tiniq suvidan keltirib qo‘yibdi. Xurshid Laylodan:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Meni kechiring, uxlab qolibman, — deb uzr so‘rabdi. Undan keyin kanizga:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Hozir suvga qarab turib bu kecha ko‘rgan tushimni aytaman, ta’birini to‘g‘ri aytasan, — debdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Тushimda, — debdi u, — xotinim Laylogul uydan chiqib, to‘g‘ri o‘z uyiga boribdi. Oyisi bir lagan osh keltirib qo‘yibdi. Oyisi Laylogulning oldiga qo‘ygan suyakni tozalab, ichidan chiqqan oshiqni cho‘ntagimga solib qo‘yibman. Shu tushim rostmikan? — deb cho‘ntagidan bir dona oshiqni chiqarib dasturxon ustiga tashlabdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Undan keyin Xurshid Laylogul o‘z uyidan chiqib ketgani, Olmagul bilan uchrashgani, uning laganidan bir dona olma olib qo‘yniga solganini aytibdi. U qo‘ynidan olmani olib dasturxon ustiga qo‘yibdi. Keyin Laylogulning Anorgul bilan uchrashgani, undan bir dona anor olganini aytibdi. Keyin ular bilan Guliqahqah parining to‘rt fasllik bog‘iga borgani, devlar bilan uchrashgani, Guliqahqah parining uyida qizlar bazmi bo‘lgani, undan keyin gulbog‘dagi hovuzda qizlarning cho‘milgani, u yerda yo‘qolgan Laylogulning kiyimini olib qo‘yniga solganini aytib, ko‘ylakni olib yoniga qo‘yibdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Xurshid boshini ko‘tarib Laylogulga qarabdi. Laylogul goh Xurshidga, goh dasturxon ustidagi olma, anorga tikilib qarar, biror og‘iz gapirishga ham madori qolmagan ekan. Xurshid kulib, indamay Laylogulga qarab turaveribdi. Тo‘satdan yuz bergan bu sirlarning ochilishiga Laylogul chiday olmabdi. Shartta o‘rnidan turibdi-da, paranjisini yopinib chiqib ketibdi. Xurshid ham peshonasiga xatni yopishtirib, uning ketidan jo‘nabdi. Laylogul to‘g‘ri Guliqahqah parining oldiga boribdi. Bugungi voqeani unga birma-bir aytib beribdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Guliqahqah pari qizning so‘zlarini diqqat bilan tinglabdi-da, o‘ylab turib:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Sen ko‘p diqqat bo‘laverma. Men ertaga azon vaqtida tosh taxtaga o‘tirib, eringning hovlisiga boraman. Agar u kitob o‘qib turgan bo‘lsa, yaxshi — senga ruxsat beraman. Qaytadan to‘y qilamiz. Agar men borgan choqda u g‘aflat uyqusida bo‘lsa, hovlisiga tosh tashlayman. Shahzoda Xurshid uy-joyi bilan yer ostiga kirib ketadi, — debdi va Laylogulga qarabdi. — Rozimisan?</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Qiz hech narsa demabdi. “Borib Xurshidga xabar bersam, pari sezib qolib meni nobud qilishi mumkin. Unga xabar bermasam, uxlab qolsa, pari uni nobud qilishi mumkin. Unda Xurshiddan ajralaman, endi nima qilish kerak?” deb Laylogul bir qarorga kelmasdan o‘rnidan turib, ketmoqchi bo‘libdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Guliqahqah pari Layloga qarab:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Bu kecha shu yerda qolasan, — debdi. Xurshid bu yerda bo‘lgan so‘zlarning hammasini eshitib uyiga jo‘nabdi. Xurshid bu kecha uxlamabdi. U sahar vaqtida o‘rnidan turib, yuvinib, toza va yangi kiyimlar kiyib, kitob o‘qib o‘tiribdi. Nihoyat, hovli tepasida “g‘uv-g‘uv, g‘uv” degan ovoz eshitilibdi. Xurshid bu ovoz Guliqahqah parining uchar tosh taxtasi ekanligini sezgan bo‘lsa ham, o‘zini bilmaslikka olib, boshini kitobdan ko‘tarib qaramabdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Guliqahqah pari hovli ustida aylanib, shahzoda Xurshidni gilam ustida kitob mutolaasida o‘tirganini ko‘ribdi. Haqiqatan, shahzoda Xurshid go‘zal, aqlli yigit ekan. Laylogulga munosib ekan, deb Guliqahqah pari o‘z bog‘iga uchib ketibdi. U Laylogulni chaqirib:</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Bor, Xurshidga ayt, to‘yni boshlasin, to‘yga men o‘zim ham boraman, — debdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Laylogul xursand bo‘lganicha yugurib Xurshid qoshiga boribdi. Qiz kelsa, u bechora hali ham kitob o‘qib o‘tirgan ekan.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">— Тuring, shahzoda, kitobni yig‘ishtiring, avval to‘yni boshlaylik, — deb kulibdi Laylogul. Xurshid Laylogulga parining ruxsat berganini, endi ular doim birga bo‘lishlarini eshitib, juda sevinibdi. Shu kuniyoq to‘y boshlanibdi. Тo‘yning uchinchi kuni parilar bilan birga Guliqahqah ham kelib, kuyov-kelinga oq fotiha beribdi.</span><br style="box-sizing: border-box; color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"/><span style="color: rgb(115, 115, 115); font-family: &quot;Fira Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">Sevishganlar murod-

